import React from 'react';
import Typewriter from 'typewriter-effect';
import { node } from 'prop-types';
import { bemVindo, welcome } from './bodyContent';


const Header = (props) => {
  const {children} = props;
  console.log(children.bemVindo);
  return (
    <div>
      <Typewriter
        onInit={(typewriter) => {
          typewriter
          .typeString(bemVindo.toString())
          .pauseFor(2000)
          .deleteAll()
          .typeString(welcome.toString())
          .start();
        }} />
    </div>
  );
}

Header.propTypes = {
  children: node.isRequired,
  // bemVindo: node.isRequired,
}

export default Header;
